file.addEventListener('change', function(e) {
    let audioSource;
    const audioContext = new AudioContext();
    console.log(this.files);
    const files = this.files;
    const audio1 = document.getElementById("audio1");
    audio1.src = URL.createObjectURL(files[0]);
    audio1.load();
    audio1.play();


    audioSource = audioContext.createMediaElementSource(audio1);
    analyser = audioContext.createAnalyser();
    audioSource.connect(analyser);
    analyser.connect(audioContext.destination);
    //The higher the number the more bars shown on canvas. 
    analyser.fftSize = 512;
      //Buffer length is half the size of the fft. 
    const bufferLength = analyser.frequencyBinCount;
    // Analyser returns the specific format and converts it to special array called Uint8Array. They are only assigned 8 bit integers. 
    const dataArray = new Uint8Array(bufferLength);
    //Width of a single bar in the buffer length. Represents one single bar in the visualizer. 
    const barWidth = 15;
    let barHeight;
    let x;
   
    function animate() {
        x = 0;
        //Clear the entire canvas
        ctx.clearRect(0, 0, canvas.width, canvas.height);
        //Calling dataArray and copies for the dataArray. DataArray gets updated over and over again.
        analyser.getByteFrequencyData(dataArray);
        drawVisualizer(bufferLength, x, barWidth, barHeight, dataArray)
        requestAnimationFrame(animate);
    }
            animate();
});

function drawVisualizer(bufferLength, x, barWidth, barHeight, dataArray) {
    //Horizontal visualizer 

    for(let i = 0; i < bufferLength; i++) {
    barHeight = dataArray[i] * 2;
    const red  = i * barHeight/30;
    const green = i/2;
    const blue = barHeight;
    ctx.fillStyle = "white"
    ctx.fillRect(canvas.width - x, canvas.height - barHeight - 30 , barWidth, 20);
    ctx.fillStyle = 'rgb(' + red + ',' + green + ',' + blue + ')';
    ctx.fillRect(canvas.width - x, canvas.height - barHeight, barWidth, barHeight);
    x += barWidth;
    }
    for(let i = 0; i < bufferLength; i++) {
        barHeight = dataArray[i] * 2;
        const red  = i * barHeight/30;
        const green = i/2;
        const blue = barHeight;
        ctx.fillStyle = "white"
        ctx.fillRect(canvas.width/2 - x, canvas.height - barHeight - 30 , barWidth, 20);
        ctx.fillStyle = 'rgb(' + red + ',' + green + ',' + blue + ')';
        ctx.fillRect(canvas.width/2 - x, canvas.height - barHeight, barWidth, barHeight);
        x += barWidth;
        }
    for(let i = 0; i < bufferLength; i++) {
        barHeight = dataArray[i] * 2;
        ctx.save();
        //Moves the canvas to the center of the canvas.
        ctx.translate(canvas.width/2, canvas.height/2);
        ctx.rotate(i * Math.PI * 12 / bufferLength);
        const red  = i * barHeight/20;
        const green = i - 40;
        const blue = barHeight * 100;
        // const hue = i * 0.3;
        // ctx.fillStyle = 'hsl(' + hue + ', 100%,' + barHeight/3 + '%)';
        ctx.fillStyle = "white"
        ctx.fillRect(0, 0 , barWidth, 3);
        ctx.fillStyle = 'rgb(' + red + ',' + green + ',' + blue + ')';
        ctx.fillRect(0, 0, barWidth, barHeight);
        x += barWidth;

        // Goes back to save state from save();
        ctx.restore();
        }

}